import React, { Component } from 'react';

class DiyList extends Component{

    constructor(props){
        super(props);
        this.state = {category: ''};
    }
    render(){
        const category = this.props.category;
        let list = '';
        switch(category){
            case 1:
                this.list = 'motor';
                break;
            case 2:
                this.list = 'wings';
                break;
            case 3:
                this.list = 'frame';
                break;
            case 4:
                this.list = 'control board';
                break;
            case 5:
                this.list = 'esc';
                break;
            case 6:
                this.list = 'battery';
                break;
            case 7:
                this.list = 'motor';
                break;
            default:
                this.list = '';
        }
        return(
            <div>
                <h2>List</h2>
                {category}
            </div>
        );
    }
}

export default DiyList;
